"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[1477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"office-hours","metadata":{"permalink":"/blog/office-hours","source":"@site/blog/2023-02-10-office-hours.md","title":"Office Hours Posted","description":"I hope that everyone had a fantastic first week of our web programming class! I am thrilled to be teaching this course this semester, and I am eager to help all of you learn the ins and outs of web programming, including the powerful and versatile JavaScript language.","date":"2023-02-10T00:00:00.000Z","formattedDate":"February 10, 2023","tags":[{"label":"information","permalink":"/blog/tags/information"}],"readingTime":0.925,"hasTruncateMarker":false,"authors":[{"name":"Tim Richards","title":"Instructor","url":"https://timdrichards.github.io","imageURL":"https://github.com/timdrichards.png","key":"richards"}],"frontMatter":{"slug":"office-hours","title":"Office Hours Posted","authors":"richards","tags":["information"]},"nextItem":{"title":"Welcome to Web Programming!","permalink":"/blog/welcome"}},"content":"I hope that everyone had a fantastic first week of our web programming class! I am thrilled to be teaching this course this semester, and I am eager to help all of you learn the ins and outs of web programming, including the powerful and versatile JavaScript language.\\n\\nThis semester is going to be an excellent one, and I am confident that each of you will leave the class with a deep understanding of the building blocks of the web. To help ensure your success, I want to bring to your attention that [office hours](/docs/information/office-hours/) are now posted and available for you to use. I encourage all of you to take advantage of this valuable resource and stop by for any questions or concerns you may have.\\n\\nFlexible learning is at the forefront of this class, and we are here to support you in any way that we can. Whether you are a beginner just starting out or have a little background in web programming, we believe that this class will have something for everyone. So let\'s have fun and charge into week two!\\n\\n![](img/js-fun.webp)"},{"id":"welcome","metadata":{"permalink":"/blog/welcome","source":"@site/blog/2023-02-06-welcome.md","title":"Welcome to Web Programming!","description":"We are thrilled to have you onboard and look forward to a challenging and enriching journey as we dive into the exciting world of web programming.","date":"2023-02-06T00:00:00.000Z","formattedDate":"February 6, 2023","tags":[{"label":"welcome","permalink":"/blog/tags/welcome"}],"readingTime":1.33,"hasTruncateMarker":false,"authors":[{"name":"Tim Richards","title":"Instructor","url":"https://timdrichards.github.io","imageURL":"https://github.com/timdrichards.png","key":"richards"}],"frontMatter":{"slug":"welcome","title":"Welcome to Web Programming!","authors":"richards","tags":["welcome"]},"prevItem":{"title":"Office Hours Posted","permalink":"/blog/office-hours"}},"content":"We are thrilled to have you onboard and look forward to a challenging and enriching journey as we dive into the exciting world of web programming.\\n\\nBy the end of this course, you will gain a fundamental understanding of web development and be able to use both front-end and back-end technologies to build stunning web applications. In particular, you will learn to create stunning designs and user experiences with HTML, CSS, and JavaScript.\\n\\nThere are several reasons why taking this course is essential for your career, both in industry and in graduate school. Here are five:\\n\\n1. Understand the latest trends in web programming: Knowing the latest web technologies will help you create and develop modern web applications that meet the latest standards in web design and usability.\\n2. Master coding and problem-solving skills: With a deep understanding of the concepts, you can effectively code and solve programming problems to complete complex tasks.\\n3. Improve job opportunities: Your web programming knowledge can provide valuable skills for landing great job opportunities.\\n4. Understand how the web works: With an in-depth knowledge of the underlying principles and how they apply to the real world, you can better understand how the web works.\\n5. Learn important development processes: Knowing the essential development processes will make you more productive and ensure the development of higher quality web applications.\\n\\nSo, what are you waiting for? Get started on this journey with us and begin mastering web programming!\\n\\nWe are looking forward to teaching you the foundations of web programming and to equipping you with the necessary tools and skills to succeed!"}]}')}}]);